import React from "react";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import FishCard from "./FishCard";


function FishList({setFishInfo, setFish, fish, search}) {

  let history = useHistory()
  function fishInfo(e){
  history.push('/info')
  console.log(e.target)
  fish.map(eachfish=> setFishInfo(eachfish["Species Illustration Photo"].src === eachfish.src))
}

  return (
   <div>
    <ul className="cards">{fish.filter(fish => fish["Species Name"].toLowerCase().includes(search.toLowerCase()))
      .map(fish => <FishCard 
      key={fish.id}
      fish={fish}
      setFish={setFish}
      setFishInfo={setFishInfo}
      fishInfo={fishInfo}
      />)}</ul>
      </div>
  );
}

export default FishList;
